const BecomeSeller = () => {
    const arr1="";
    const arr2="";
    const history = useHistory();


    const submitData = () => {
        const id = SessionManager.getUserId()
        NodeFetchHelper.put(`http://localhost:2000/users/${id}`,null,
            {Authorization: 'Bearer ' + SessionManager.getAccessToken()},
            {name: "rod"},
            (status, jsonData, ok) => {
                console.log(jsonData)
                if (ok) {
                    confirmAlert({

                        message: 'Your request is on process, We will get back to you soon.',
                        buttons: [
                            {
                                label: 'Ok',
                                onClick: () => {
                                    let path = "/";
                                    history.push(path);
                                }

                            },
                        ]
                    });
                }
                else {
                    confirmAlert({

                        message: 'Please recheck your inputs.',
                        buttons: [
                            {
                                label: 'Ok',
                                onClick: () => {
                                    let path = "/becomeSeller";
                                    history.push(path);
                                }

                            },
                        ]
                    });

                }
            })



    };
    const classes = useStyles();
    return (
        <Grid container xs={12}>
            <Paper className={classes.paper}>
                <Grid container xs={12} align={'center'}>
                    <Grid xs={6}>
                        <TextField label="Phone Number" id="standard-size-small" size="small" onChange={(event) => {
                            arr1 : event.target.value;
                            console.log(arr1)
                        }}/>


                    </Grid>
                    <Grid xs={6}>
                        <TextField label="Alternative Phone Number" id="standard-size-small" size="small"onChange={(event) => {
                            {arr2 :event.target.value;}
                            console.log(arr2)
                        }}/>

                    </Grid>
                    <Grid xs={12}>
                        <TextField label="Current Location" id="standard-size-small" size="small"/>
                    </Grid>
                    <Grid xs={12}>
                        <TextField label="Permanent Location" id="standard-size-small" size="small"/>

                    </Grid>
                    <Grid xs={12}>
                        <TextField label="Password" id="standard-size-small" size="small"/>
                    </Grid>
                    {/*<Grid xs={12}>*/}
                    {/*    <TextField label=" Confirm Password" id="standard-size-small" size="small"/>*/}
                    {/*</Grid>*/}
                    <Grid xs={12}>
                        <Button onClick={submitData}> Submit </Button>
                    </Grid>
                </Grid>


            </Paper>

            <Grid container xs={6}>
            </Grid>


        </Grid>

    )
        ;
};

export default BecomeSeller;
